import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // The page dynamically loads products, so we wait for the first 'Add to Cart' button to appear.
    const firstAddToCartButton = page.locator('.add-to-cart').first();
    await firstAddToCartButton.waitFor({ state: 'visible', timeout: 5000 });

    // Click the first "Add to Cart" button
    await firstAddToCartButton.click();

    // Take a screenshot after adding the item to the cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // Verify the item was added by checking localStorage, as the script updates it.
    const cartData = await page.evaluate(() => {
      return localStorage.getItem('amazonCart');
    });

    if (!cartData) {
      throw new Error('Cart data not found in localStorage.');
    }

    const parsedCart = JSON.parse(cartData);

    if (parsedCart.length !== 1) {
      throw new Error(`Expected 1 item in cart, but found ${parsedCart.length}.`);
    }

    const extractedData = {
      cartItemCount: parsedCart.length,
      firstItemTitle: parsedCart[0].title,
      firstItemPrice: parsedCart[0].price
    };

    return {
      success: true,
      action: "Added the first product to the cart and verified via localStorage.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add the first product to the cart.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
